import React from 'react';

const PostCard = () => {
  return (
    <div>
      <Card cover={postMessage.Images[e]}>
        <Image />
        <Content />
        <Buttons></Buttons>
      </Card>
      <CommentForm />
      <Comments />
    </div>
  );
};

export default PostCard;
